import { BrowserRouter as Router, Switch, Route} from "react-router-dom";
import React from 'react';

import Login from './LandingSignUpLogin/Login';
import MessageCenter from './MessageCenter/Message-Center'

export default (
	<Router>
		<Switch>
			<Route path='/'>
				<Login/>
			</Route>
			<Route path='message'>
				<MessageCenter/>
			</Route>
		</Switch>
	</Router>

);
